/**
 * Returns true if <code>o1<code>'s weight is less than that of <code>o2</code>, for
 * ordering in the PQ.
 * @return True if <code>o1</code> weighs less than <code>o2</code>.
 */
@Override
public boolean lessThan(MI o1, MI o2) {
  return o1.value < o2.value;
}

